	/**
	 * https://stackoverflow.com/questions/9330394/how-to-pick-an-item-by-its-probability
	 * @param random
	 * @param nTimeslots
	 * @return
	 */
	public static Tuple getTimeslotsFromDistribution(double random, int nTimeslots) {
		// Iterate over distributions per timeslot, summing up progressively
		// until we "find" the correct slot
		double distSoFar = 0;
		
		// Calculate ratio in case nTimeslots does not match all availabletimeslots
		double ratio = nTimeslots*1.0 / distribution.length;
		
		for (int arrivalTimeslot=0;arrivalTimeslot<distribution.length;arrivalTimeslot++) {
			for (int departureTimeslot=0;departureTimeslot<distribution[arrivalTimeslot].length;departureTimeslot++) {
				distSoFar += distribution[arrivalTimeslot][departureTimeslot];
				if (random <= distSoFar) 
					return new Tuple(
							(int) Math.floor(arrivalTimeslot*ratio),
							(int) Math.floor(departureTimeslot*ratio)
					);
			}
			
		}
		throw new NullPointerException();
	}
	
	
